import React, { useEffect, useState } from "react";
import api from "../../services/api";


const TradePage = () => {
    const [pokemon, setPokemon] = useState([]);

    useEffect(() => {
        api
            .get("/")
            .then((response) => setPokemon(response.data.name))
            .catch((error) =>{
                console.error(error);
            })
    } , []);



    return(
        <div>
            {pokemon}
        </div>
    )
}

export default TradePage;
